	@Override
	public final int tAction(int state, int sym) {
		if (sym == 0)
			return ERROR_ACTION;
		int i = baseAction[state], k = i + sym;
		if (termCheck[k] == sym)
			return termAction[k];
		i = termAction[i];
		return (shiftCheck[shiftState[i] + sym] == sym ? defaultShift[sym] : defaultReduce[i]);
	}

	@Override
	public final int lookAhead(int la_state, int sym) {
		int k = la_state + sym;
		if (termCheck[k] == sym)
			return termAction[k];
		int i = termAction[la_state];
		return (shiftCheck[shiftState[i] + sym] == sym ? defaultShift[sym] : defaultReduce[i]);
	}
